import React, { useState } from "react";
import "./RequestEdit.css";
import { RequestEditTest } from "./RequestEditTest";

export const App = () => {
  const [showModal, setShowModal] = useState(false);
const openModal = () => {
    setShowModal(true);
  };
  return (
    <div className="App">
      <h1>Popup Modal</h1>
      <button onClick={openModal}>Open Modal</button>
      {showModal ? <RequestEditTest setShowModal={setShowModal} /> : null}
    </div>
  );
}
